import React, { useEffect, useState } from 'react';
import apiGetJobs from '../api_call/getJobs';

function Jobs() {
  const [jobs, setJobs] = useState([]);
  useEffect(() => {
    const getJobs = async () => {
      setJobs(await apiGetJobs());
    }
    getJobs();
    console.log(jobs);
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return(
    <div>
      Hello World!
    </div>
  );
}

export default Jobs;
